# https://leetcode.com/problems/find-all-anagrams-in-a-string/description/
class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        result = []
        p_map = {}
        for each in p:
            p_map[each] = p.count(each)
        i = 0
        while i <= len(s) - len(p):
            tmp = s[i:i + len(p)]
            match = True
            for each in p_map:
                if p_map[each] != tmp.count(each):
                    match = False
                    break
            if match:
                result.append(i)

            while i < len(s) - len(p) and s[i + len(p)] == s[i]:
                i += 1
                if match:
                    result.append(i)
            i += 1

        return result

s = Solution()
print(s.findAnagrams("abab", "ab"))

